import NewList from "./NewList";
import { FaTimes } from "react-icons/fa";

const List = ({ list }) => {
  console.log(list);
  return (
    <div>
      <ul>
        {Object.keys(list).length
          ? Object.keys(list).map((key, i) => (
              <>
                <li key={key}>
                  {key} <FaTrash style={{ color: "red", cursor: "pointer" }} />
                </li>
                <NewList list={list[key]} />
              </>
            ))
          : ""}
      </ul>
    </div>
  );
};

export default List;
